import {
    createBrowserRouter,
    RouterProvider,
    Route,
} from "react-router-dom"
import Home from "./routes/Home";

function App() {
    const router = createBrowserRouter([
        {
            path: "/",
            element: (
                <div>
                    <h1>Hello World</h1>
                    <Link to="about">About Us</Link>
                </div>
            ),
        },
        {
            path: "about",
            element: <div>About</div>,
        },
    ]);
}

export default App;
